import React, { useEffect, useState } from 'react';
import axios from "axios";
import '../styles/Sample.css';
import {GET_SAMPLES} from "../constants/back";

export default function Sample() {
  const [samples, setSamples] = useState([]);

  const setEmployeeData = async () => {
    axios.get(GET_SAMPLES).then((response) => {
      setSamples(response.data);
    }).catch(error => {
      alert("Error Ocurred while loading data:" + error);
    });
  }

  useEffect(() => {
    const intervalId = setInterval(setEmployeeData, 5000);
    return () => clearInterval(intervalId);
  }, []);

  if (samples.length === 0)
    return (<div>Loading...</div>)
  return (
      <div>
      <h4>Samples List</h4>
      <div className="row">
        <div className="col-12">
          <table className="table table-bordered table-striped">
            <thead>
            <tr>
              <th>Id</th>
              <th>Date</th>
              <th>String</th>
              <th>Float</th>
              <th>Type</th>
              <th scope="col">Action</th>

            </tr>
            </thead>
            <tbody>

            {
                samples.map( (sample, index) => (
                    <tr key={index}>
                      <th scope="row">{sample.idSample}</th>
                      <td>{sample.dateSample}</td>
                      <td>{sample.stringSample}</td>
                      <td>{sample.floatSample}</td>
                      <td>{sample.sampleType}</td>
                    </tr>

                ))
            }

            </tbody>
          </table>
        </div>
      </div>
      </div>
  );
};
